async function getStaticProps() {
    const res = await fetch("http://206.189.56.129/wp-json/wp/v2/aktuality");
    const posts = await res.json();
    var data = [];
    for(let aktualita in posts){
        data.unshift({
            nadpis: posts[aktualita].title.rendered,
            datum: posts[aktualita].x_date,
            text: posts[aktualita].content.rendered.replace("<p>", "").replace("</p>", ""),
            image: posts[aktualita].acf.fotka,
            image: posts[aktualita].acf.priloha,
            id: posts[aktualita].id
        });
    }
    return {
        props: {
            data
        },
        // Next.js will attempt to re-generate the page:
        // - When a request comes in
        // - At most once every 10 seconds
        revalidate: 10
    };
}


